import Card from "./Card";
import {bio} from "./robot";
import React from "react";

<div>
    <Card id={bio[0].id} name={bio[0].name} email={bio[0].email}/>
    <Card id={bio[1].id} name={bio[1].name} email={bio[1].email}/>
    <Card id={bio[2].id} name={bio[2].name} email={bio[2].email}/>
    <Card id={bio[3].id} name={bio[3].name} email={bio[3].email}/>
    <Card id={bio[4].id} name={bio[4].name} email={bio[4].email}/>
</div>
